import React from "react";

function Tarih(props) {
  const { date, setDate } = props;
  return (
    <div>
      <label htmlFor="date">Select Date</label>
      <input
        type="date"
        id="date"
        value={date}
        onChange={(event) => {
          setDate(event.target.value);
          console.log(date);
        }}
      ></input>
    </div>
  );
}

export default Tarih;
